path::PathBuf::with_capacity.doc:
Creates a new `PathBuf` with a given capacity used to create the
internal [`OsString`]. See [`with_capacity`] defined on [`OsString`].

# Examples

```
use std::path::PathBuf;

let mut path = PathBuf::with_capacity(10);
let capacity = path.capacity();

// This push is done without reallocating
path.push(r"C:\");

assert_eq!(capacity, path.capacity());
```

[`with_capacity`]: OsString::with_capacity

alloc_crate::string::String::with_capaci.doc:
Creates a new empty `String` with at least the specified capacity.

`String`s have an internal buffer to hold their data. The capacity is
the length of that buffer, and can be queried with the [`capacity`]
method. This method creates an empty `String`, but one with an initial
buffer that can hold at least `capacity` bytes. This is useful when you
may be appending a bunch of data to the `String`, reducing the number of
reallocations it needs to do.

[`capacity`]: String::capacity

If the given capacity is `0`, no allocation will occur, and this method
is identical to the [`new`] method.

[`new`]: String::new

# Panics

Panics if the capacity exceeds `isize::MAX` _bytes_.

# Examples

```
let mut s = String::with_capacity(10);

// The String contains no chars, even though it has capacity for more
assert_eq!(s.len(), 0);

// These are all done without reallocating...
let cap = s.capacity();
for _ in 0..10 {
    s.push('a');
}

assert_eq!(s.capacity(), cap);

// ...but this may make the string reallocate
s.push('a');
```

path::PathBuf::push.doc:
Extends `self` with `path`.

If `path` is absolute, it replaces the current path.

On Windows:

* if `path` has a root but no prefix (e.g., `\windows`), it
  replaces everything except for the prefix (if any) of `self`.
* if `path` has a prefix but no root, it replaces `self`.
* if `self` has a verbatim prefix (e.g. `\\?\C:\windows`)
  and `path` is not empty, the new path is normalized: all references
  to `.` and `..` are removed.

Consider using [`Path::join`] if you need a new `PathBuf` instead of
using this function on a cloned `PathBuf`.

# Examples

Pushing a relative path extends the existing path:

```
use std::path::PathBuf;

let mut path = PathBuf::from("/tmp");
path.push("file.bk");
assert_eq!(path, PathBuf::from("/tmp/file.bk"));
```

Pushing an absolute path replaces the existing path:

```
use std::path::PathBuf;

let mut path = PathBuf::from("/tmp");
path.push("/etc");
assert_eq!(path, PathBuf::from("/etc"));
```

path::PathBuf::pop.doc:
Truncates `self` to [`self.parent`].

Returns `false` and does nothing if [`self.parent`] is [`None`].
Otherwise, returns `true`.

[`self.parent`]: Path::parent

# Examples

```
use std::path::{Path, PathBuf};

let mut p = PathBuf::from("/spirited/away.rs");

p.pop();
assert_eq!(Path::new("/spirited"), p);
p.pop();
assert_eq!(Path::new("/"), p);
```

path::Path::starts_with.doc:
Determines whether `base` is a prefix of `self`.

Only considers whole path components to match.

# Examples

```
use std::path::Path;

let path = Path::new("/etc/passwd");

assert!(path.starts_with("/etc"));
assert!(path.starts_with("/etc/"));
assert!(path.starts_with("/etc/passwd"));
assert!(path.starts_with("/etc/passwd/")); // extra slash is okay
assert!(path.starts_with("/etc/passwd///")); // multiple extra slashes are okay

assert!(!path.starts_with("/e"));
assert!(!path.starts_with("/etc/passwd.txt"));

assert!(!Path::new("/etc/foo.rs").starts_with("/etc/foo"));
```

alloc_crate::string::String::clear.doc:
Truncates this `String`, removing all contents.

While this means the `String` will have a length of zero, it does not
touch its capacity.

# Examples

```
let mut s = String::from("foo");

s.clear();

assert!(s.is_empty());
assert_eq!(0, s.len());
assert_eq!(3, s.capacity());
```

fs::File::open.doc:
Attempts to open a file in read-only mode.

See the [`OpenOptions::open`] method for more details.

If you only need to read the entire file contents,
consider [`std::fs::read()`][self::read] or
[`std::fs::read_to_string()`][self::read_to_string] instead.

# Errors

This function will return an error if `path` does not already exist.
Other errors may also be returned according to [`OpenOptions::open`].

# Examples

```no_run
use std::fs::File;
use std::io::Read;

fn main() -> std::io::Result<()> {
    let mut f = File::open("foo.txt")?;
    let mut data = vec![];
    f.read_to_end(&mut data)?;
    Ok(())
}
```

core::result::Result::<T, E>::and_then.doc:
Calls `op` if the result is [`Ok`], otherwise returns the [`Err`] value of `self`.


This function can be used for control flow based on `Result` values.

# Examples

```
fn sq_then_to_string(x: u32) -> Result<String, &'static str> {
    x.checked_mul(x).map(|sq| sq.to_string()).ok_or("overflowed")
}

assert_eq!(Ok(2).and_then(sq_then_to_string), Ok(4.to_string()));
assert_eq!(Ok(1_000_000).and_then(sq_then_to_string), Err("overflowed"));
assert_eq!(Err("not a number").and_then(sq_then_to_string), Err("not a number"));
```

Often used to chain fallible operations that may return [`Err`].

```
use std::{io::ErrorKind, path::Path};

// Note: on Windows "/" maps to "C:\"
let root_modified_time = Path::new("/").metadata().and_then(|md| md.modified());
assert!(root_modified_time.is_ok());

let should_fail = Path::new("/bad/path").metadata().and_then(|md| md.modified());
assert!(should_fail.is_err());
assert_eq!(should_fail.unwrap_err().kind(), ErrorKind::NotFound);
```

core::result::Result::<T, E>::is_ok.doc:
Returns `true` if the result is [`Ok`].

# Examples

```
let x: Result<i32, &str> = Ok(-3);
assert_eq!(x.is_ok(), true);

let x: Result<i32, &str> = Err("Some error message");
assert_eq!(x.is_ok(), false);
```

core::str::<impl str>::lines.doc:
Returns an iterator over the lines of a string, as string slices.

Lines are split at line endings that are either newlines (`\n`) or
sequences of a carriage return followed by a line feed (`\r\n`).

Line terminators are not included in the lines returned by the iterator.

Note that any carriage return (`\r`) not immediately followed by a
line feed (`\n`) does not split a line. These carriage returns are
thereby included in the produced lines.

The final line ending is optional. A string that ends with a final line
ending will return the same lines as an otherwise identical string
without a final line ending.

An empty string returns an empty iterator.

# Examples

Basic usage:

```
let text = "foo\r\nbar\n\nbaz\r";
let mut lines = text.lines();

assert_eq!(Some("foo"), lines.next());
assert_eq!(Some("bar"), lines.next());
assert_eq!(Some(""), lines.next());
// Trailing carriage return is included in the last line
assert_eq!(Some("baz\r"), lines.next());

assert_eq!(None, lines.next());
```

The final line does not require any ending:

```
let text = "foo\nbar\n\r\nbaz";
let mut lines = text.lines();

assert_eq!(Some("foo"), lines.next());
assert_eq!(Some("bar"), lines.next());
assert_eq!(Some(""), lines.next());
assert_eq!(Some("baz"), lines.next());

assert_eq!(None, lines.next());
```

An empty string returns an empty iterator:

```
let text = "";
let mut lines = text.lines();

assert_eq!(lines.next(), None);
```

core::iter::Iterator::next.doc:
Advances the iterator and returns the next value.

Returns [`None`] when iteration is finished. Individual iterator
implementations may choose to resume iteration, and so calling `next()`
again may or may not eventually start returning [`Some(Item)`] again at some
point.

[`Some(Item)`]: Some

# Examples

```
let a = [1, 2, 3];

let mut iter = a.into_iter();

// A call to next() returns the next value...
assert_eq!(Some(1), iter.next());
assert_eq!(Some(2), iter.next());
assert_eq!(Some(3), iter.next());

// ... and then None once it's over.
assert_eq!(None, iter.next());

// More calls may or may not return `None`. Here, they always will.
assert_eq!(None, iter.next());
assert_eq!(None, iter.next());
```

core::ops::Try::branch.doc:
Used in `?` to decide whether the operator should produce a value
(because this returned [`ControlFlow::Continue`])
or propagate a value back to the caller
(because this returned [`ControlFlow::Break`]).

# Examples

```
#![feature(try_trait_v2)]
use std::ops::{ControlFlow, Try};

assert_eq!(Ok::<_, String>(3).branch(), ControlFlow::Continue(3));
assert_eq!(Err::<String, _>(3).branch(), ControlFlow::Break(Err(3)));

assert_eq!(Some(3).branch(), ControlFlow::Continue(3));
assert_eq!(None::<String>.branch(), ControlFlow::Break(None));

assert_eq!(ControlFlow::<String, _>::Continue(3).branch(), ControlFlow::Continue(3));
assert_eq!(
    ControlFlow::<_, String>::Break(3).branch(),
    ControlFlow::Break(ControlFlow::Break(3)),
);
```

core::str::<impl str>::split.doc:
Returns an iterator over substrings of this string slice, separated by
characters matched by a pattern.

The [pattern] can be a `&str`, [`char`], a slice of [`char`]s, or a
function or closure that determines if a character matches.

If there are no matches the full string slice is returned as the only
item in the iterator.

[`char`]: prim@char
[pattern]: self::pattern

# Iterator behavior

The returned iterator will be a [`DoubleEndedIterator`] if the pattern
allows a reverse search and forward/reverse search yields the same
elements. This is true for, e.g., [`char`], but not for `&str`.

If the pattern allows a reverse search but its results might differ
from a forward search, the [`rsplit`] method can be used.

[`rsplit`]: str::rsplit

# Examples

Simple patterns:

```
let v: Vec<&str> = "Mary had a little lamb".split(' ').collect();
assert_eq!(v, ["Mary", "had", "a", "little", "lamb"]);

let v: Vec<&str> = "".split('X').collect();
assert_eq!(v, [""]);

let v: Vec<&str> = "lionXXtigerXleopard".split('X').collect();
assert_eq!(v, ["lion", "", "tiger", "leopard"]);

let v: Vec<&str> = "lion::tiger::leopard".split("::").collect();
assert_eq!(v, ["lion", "tiger", "leopard"]);

let v: Vec<&str> = "AABBCC".split("DD").collect();
assert_eq!(v, ["AABBCC"]);

let v: Vec<&str> = "abc1def2ghi".split(char::is_numeric).collect();
assert_eq!(v, ["abc", "def", "ghi"]);

let v: Vec<&str> = "lionXtigerXleopard".split(char::is_uppercase).collect();
assert_eq!(v, ["lion", "tiger", "leopard"]);
```

If the pattern is a slice of chars, split on each occurrence of any of the characters:

```
let v: Vec<&str> = "2020-11-03 23:59".split(&['-', ' ', ':', '@'][..]).collect();
assert_eq!(v, ["2020", "11", "03", "23", "59"]);
```

A more complex pattern, using a closure:

```
let v: Vec<&str> = "abc1defXghi".split(|c| c == '1' || c == 'X').collect();
assert_eq!(v, ["abc", "def", "ghi"]);
```

If a string contains multiple contiguous separators, you will end up
with empty strings in the output:

```
let x = "||||a||b|c".to_string();
let d: Vec<_> = x.split('|').collect();

assert_eq!(d, &["", "", "", "", "a", "", "b", "c"]);
```

Contiguous separators are separated by the empty string.

```
let x = "(///)".to_string();
let d: Vec<_> = x.split('/').collect();

assert_eq!(d, &["(", "", "", ")"]);
```

Separators at the start or end of a string are neighbored
by empty strings.

```
let d: Vec<_> = "010".split("0").collect();
assert_eq!(d, &["", "1", ""]);
```

When the empty string is used as a separator, it separates
every character in the string, along with the beginning
and end of the string.

```
let f: Vec<_> = "rust".split("").collect();
assert_eq!(f, &["", "r", "u", "s", "t", ""]);
```

Contiguous separators can lead to possibly surprising behavior
when whitespace is used as the separator. This code is correct:

```
let x = "    a  b c".to_string();
let d: Vec<_> = x.split(' ').collect();

assert_eq!(d, &["", "", "", "", "a", "", "b", "c"]);
```

It does _not_ give you:

```,ignore
assert_eq!(d, &["a", "b", "c"]);
```

Use [`split_whitespace`] for this behavior.

[`split_whitespace`]: str::split_whitespace

core::cmp::Ord::min.doc:
Compares and returns the minimum of two values.

Returns the first argument if the comparison determines them to be equal.

# Examples

```
assert_eq!(1.min(2), 1);
assert_eq!(2.min(2), 2);
```
